■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/netg_bc0000/cc1377-01.jpg" width="600" height="800"><br><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/netg_bc0000/cc1377-02.jpg" width="600" height="457"><br><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/netg_bc0000/cc1377-03.jpg" width="600" height="298"><br><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/netg_bc0000/cc1377-04.jpg" width="600" height="226"></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">30年のロングセラー！子犬や子猫のための自動給水器が新しくなって登場！衛生面にこだわって作られたので、飲み水にホコリやゴミが入らず安心。デリケートな子犬・子猫にいつもきれいなお水を飲ませることができます。小さな体を元気に育てましょう♪</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"> <td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1"> サイズ </font></td><td width="75%" align="left"><font color="#333333" size="-1">容量：500ml</font></td></tr><tr bgcolor="#FFFFFF"> <td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">750g</font></td></tr><tr bgcolor="#FFFFFF"> <td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ビン：ガラス(耐熱ではない）<br>口金パイプ：ステンレス<br>プラカバー：プラスチック<br>ゴム栓：合成ゴム<br>ホルダー：強化プラスチック</font></td></tr><tr bgcolor="#FFFFFF"> <td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
